import pflText from "../Assets/pflt.png";
import Table from "../Table.js";
export default function Points() {
  return (
    <div>
      <img
        src={pflText}
        alt="Logo"
        style={{
          display: "block",
          margin: "auto",
          width: "300px",
          marginTop: "20px",
        }}
      />
      <div class="card-container">
        <div class="top-card-container">
          <div class="card">
            <p class="card-header clubName  ">Club Name</p>
            <p class="card-header matches   ">MP</p>
            <p class="card-header wins      ">W</p>
            <p class="card-header draws     ">D</p>
            <p class="card-header defeats   ">L</p>
            <p class="card-header scored    ">GF</p>
            <p class="card-header received  ">GA</p>
            <p class="card-header scored    ">GD</p>
            <p class="card-header points    ">Points</p>
          </div>
        </div>
      </div>
    </div>
  );
}
